import React, {useState, useEffect} from "react";
import { useParams } from "react-router-dom";
import { VerticalTimeline, VerticalTimelineElement }  from 'react-vertical-timeline-component';
import 'react-vertical-timeline-component/style.min.css';


function About() {
  let {profile} = useParams()
  const [data, setData] = useState([])
  useEffect(() => {
    fetch(`http://localhost:3001/${profile}`).then(res => res.json()).then(
        result => {
            setData(result.experience)
            // console.log(result)
        }
    ).catch(console.log);
  }, []);

  var addToTimeline = data.map((item, index) => {
    return (
      index == 0 ?
      <VerticalTimelineElement
            className="vertical-timeline-element--work"
            contentStyle={{ background: '#2a7b77', color: '#fff' }}
            contentArrowStyle={{ borderRight: '7px solid  #2a7b77' }}
            date={item.year}
            iconStyle={{ background: '#696969', color: '#fff' }}
          >
            <h3 className="vertical-timeline-element-title"><b>{item.role}</b></h3>
            <h4 className="vertical-timeline-element-subtitle"><b>{item.name}</b></h4>
            <h5>{item.year}</h5>
            <p>
              <span><b>{item.description}</b></span>
            </p>
      </VerticalTimelineElement>
      :
      <VerticalTimelineElement
            className="vertical-timeline-element--work"
            // contentStyle={{ background: '#2a7b77', color: '#fff' }}
            contentArrowStyle={{ borderRight: '7px solid  #2a7b77' }}
            date={item.year}
            iconStyle={{ background: '#696969', color: '#fff' }}
          >
            <h3 className="vertical-timeline-element-title"><b>{item.role}</b></h3>
            <h4 className="vertical-timeline-element-subtitle"><b>{item.name}</b></h4>
            <p>
              <span><b>{item.description}</b></span>
            </p>
      </VerticalTimelineElement>
    );
  });

  return (
    <div style={{backgroundColor: '#d7d7d7', position:'sticky', zIndex: '-10'}}>
        <VerticalTimeline>
          <VerticalTimelineElement
            className="vertical-timeline-element--work"
            contentStyle={{ background: '#2a7b77', color: '#fff' }}
            contentArrowStyle={{ borderRight: '7px solid  #2a7b77' }}
            date="2011 - present"
            iconStyle={{ background: '#696969', color: '#fff' }}
          >
            <h3 className="vertical-timeline-element-title"><b>Masters' in Information Systems</b></h3>
            <h4 className="vertical-timeline-element-subtitle"><b>Northeastern University, Boston</b></h4>
            <p>
              <span><b>Coursework :</b></span> Application Engineering and Development, Data Science Engineering Methods and Tools, Big Data Architecture and Intelligence Analytics, Database Management and Database Design
            </p>
          </VerticalTimelineElement>
          <VerticalTimelineElement
            className="vertical-timeline-element--work"
            date="2022 - 2024"
            iconStyle={{ background: '#696969', color: '#fff' }}
          >
            <h3 className="vertical-timeline-element-title">Data Engineer</h3>
            <h4 className="vertical-timeline-element-subtitle">Societe Generale, Bangalore, India</h4>
            <p>
              Creative Direction, User Experience, Visual Design, SEO, Online Marketing
            </p>
          </VerticalTimelineElement>
          <VerticalTimelineElement
            className="vertical-timeline-element--work"
            date="2016 - 2020"
            iconStyle={{ background: '#696969', color: '#fff' }}
          >
            <h3 className="vertical-timeline-element-title">Data Engineer</h3>
            <h4 className="vertical-timeline-element-subtitle">Societe Generale, Bangalore, India</h4>
            <p>
              User Experience, Visual Design
            </p>
          </VerticalTimelineElement>
          <VerticalTimelineElement
            className="vertical-timeline-element--work"
            date="2006 - 2008"
            iconStyle={{ background: '#696969', color: '#fff' }}
          >
            <h3 className="vertical-timeline-element-title">Web Designer</h3>
            <h4 className="vertical-timeline-element-subtitle">San Francisco, CA</h4>
            <p>
              User Experience, Visual Design
            </p>
          </VerticalTimelineElement>
          <VerticalTimelineElement
            className="vertical-timeline-element--education"
            date="April 2013"
            iconStyle={{ background: '#696969', color: '#fff' }}
          >
            <h3 className="vertical-timeline-element-title">Content Marketing for Web, Mobile and Social Media</h3>
            <h4 className="vertical-timeline-element-subtitle">Online Course</h4>
            <p>
              Strategy, Social Media
            </p>
          </VerticalTimelineElement>
          <VerticalTimelineElement
            className="vertical-timeline-element--education"
            date="November 2012"
            iconStyle={{ background: '#696969', color: '#fff' }}
          >
            <h3 className="vertical-timeline-element-title">Agile Development Scrum Master</h3>
            <h4 className="vertical-timeline-element-subtitle">Certification</h4>
            <p>
              Creative Direction, User Experience, Visual Design
            </p>
          </VerticalTimelineElement>
          <VerticalTimelineElement
            className="vertical-timeline-element--education"
            date="2002 - 2006"
            iconStyle={{ background: '#696969', color: '#fff' }}
          >
            <h3 className="vertical-timeline-element-title">Bachelor of Science in Interactive Digital Media Visual Imaging</h3>
            <h4 className="vertical-timeline-element-subtitle">Bachelor Degree</h4>
            <p>
              Creative Direction, Visual Design
            </p>
          </VerticalTimelineElement>
          <VerticalTimelineElement
            iconStyle={{ background: '#696969', color: '#fff' }}
          />
        </VerticalTimeline>

    </div>
  );
}

export default About;
